import React from "react";
import { Row, Col } from "react-bootstrap";

import Heading from "../Heading";
import Events from "./Events";

function ActivityEvent() {
  return (
    <Row>
      <Col sm={12} className="my-1 mx-auto" id="activityEvent">
        <Heading
          content="Events & Activities"
          design="fw-bold fs-5 bg-info text-white rounded text-center mb-3"
        />
        <Events
          source="https://www.facebook.com/plugins/video.php?height=314&href=https%3A%2F%2Fweb.facebook.com%2FMYzomin%2Fvideos%2F399775174355560%2F&show_text=false&width=560&t=0"
          eventName="Going to Work during Pandemic"
          eventDate="13th October 2020"
        />
        <Events
          source="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FMYzomin%2Fvideos%2F1192498367864603%2F&show_text=0&width=560"
          eventName="Selam"
          eventDate="11th May 2022"
        />
         <Events
          source="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2FMYzomin%2Fvideos%2F140591171347821%2F&show_text=0&width=560"
          eventName="Selam"
          eventDate="11th May 2022"
        />
        <iframe src="https://www.facebook.com/plugins/video.php?height=314&href=https%3A%2F%2Fweb.facebook.com%2FMYzomin%2Fvideos%2F399775174355560%2F&show_text=false&width=560&t=0" width="560" height="314" style="border:none;overflow:hidden" scrolling="no" frameborder="0" allowfullscreen="true" allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share" allowFullScreen="true"></iframe>

      </Col>
    </Row>
  );
}

export default ActivityEvent;
